INSERT INTO `wp_config` (`id`,`name`,`type`,`title`,`group`,`extra`,`remark`,`create_time`,`update_time`,`status`,`value`,`sort`) VALUES ('31','zcxy','2','注册协议','1','','','1520865455','1520865455','1','<p>	本协议是您与北红商城所有者之间就北红商城网站服务等相关事宜所订立的契约，请您仔细阅读本注册协议，您点击“同意并继续”按钮后，本协议即构成对双方有约束力的法律文件。<br/>第一条北红商城服务条款的确认和接纳<br/>1.1北红商城的各项电子服务的所有权和运作权归北红商城所有。用户同意所有注册协议条款并完成注册程序，才能成为北红商城的正式用户。用户确认：本协议条款是处理双方权利义务的契约，始终有效，法律另有强制性规定或双方另有特别约定的，依其规定。<br/>1.2用户点击同意本协议的，即视为用户确认自己具有享受北红商城服务、下单购物等相应的权利能力和行为能力，能够独立承担法律责任。<br/>1.3如果您在18周岁以下，您则不能注册北红商城用户。<br/>1.4北红商城保留在中华人民共和国大陆地区施行之法律允许的范围内独自决定拒绝服务、关闭用户账户、清除或编辑内容或取消订单的权利。<br/>第二条北红商城服务<br/>北红商城通过互联网依法为用户提供互联网信息等服务，用户在完全同意本协议及北红商城规定的情况下，方有权使用北红商城的相关服务。<br/>第三条用户信息及隐私保护<br/>3.1用户应自行诚信向北红商城提供注册资料，用户确保其提供的注册资料真实、准确、完整、合法有效，用户注册资料如有变动的，应及时更新其注册资料。如果用户提供的注册资料不合法、不真实、不准确、不详尽、或变更信息不及时的，用户需承担因此引起的相应责任及后果，并且北红商城保留终止用户使用北红商城各项服务的权利。<br/>3.2用户同意，北红商城拥有通过邮件、短信电话等形式，向在北红商城注册、购物用户、收货人发送订单信息、促销活动等告知信息的权利。<br/>3.3一旦注册成功成为用户，用户将得到一个密码和帐号，用户需要对自己在帐户中的所有活动和事件负责。如果由于自身的过失导致帐号和密码脱离控制，由此导致的针对您、或任何第三方造成的损害，用户将承担全部责任。<br/>3.4保护用户隐私是北红商城的一项基本政策，北红商城保证不对外公开或向第三方提供单个用户的注册资料及用户在使用网络服务时存储在北红商城的非公开内容，但下列情况除外：（1）事先获得用户的明确授权或同意；（2）根据有关的法律法规要求；（3）按照相关政府主管部门的要求；（4）为维护社会公众的利益；（5）为维护北红商城的合法权益。<br/>3.5在不透露单个用户隐私资料的前提下，北红商城有权对整个用户数据库进行分析并对用户数据库进行商业上的利用。<br/>第四条用户依法言行义务<br/>本协议依据国家相关法律法规规章制定，用户同意严格遵守以下义务：<br/>4.1遵守中国有关的法律和法规；<br/>4.2遵守所有与网络服务有关的网络协议、规定和程序；<br/>4.3不得为任何非法目的而使用北红商城网络服务系统；<br/>4.4不得利用北红商城网络服务系统进行任何可能对互联网或移动网正常运转造成不利影响的行为；<br/>4.5不得利用北红商城提供的网络服务上传、展示或传播任何虚假的、骚扰性的、中伤他人的、辱骂性的、恐吓性的、庸俗淫秽的或其他任何非法的信息资料；<br/>4.6不得侵犯北红商城的专利权、著作权、商标权、名誉权或其他任何合法权益；<br/>4.7如发现任何非法使用用户帐号或帐号出现安全漏洞的情况，应立即通知北红商城。<br/>用户应及时关注并遵守北红商城不时公布或修改的各类合法规则规定。<br/>北红商城保有删除站内各类不符合法律政策或不真实的信息内容而无须通知用户的权利。<br/>用户须对自己在网上的言论和行为承担法律责任。<br/>第五条商品信息<br/>北红商城上的商品价格、数量、是否有货等商品信息随时都有可能发生变动，北红商城不作特别通知。由于商城上商品信息的数量庞大，虽然北红商城会尽最大努力保证您所浏览商品信息的准确性，但由于众所周知的互联网技术因素等客观原因存在，商城显示的信息可能会有一定的滞后性或差错，对此情形您知悉并理解，同意免除北红商城商城的责任。<br/>第六条订单<br/>6.1在您下订单时，请您仔细确认所购商品的名称、价格、数量、型号、规格、尺寸、联系地址、电话、收货人等信息。收货人与用户本人不一致的，收货人的行为和意思表示视为用户的行为和意思表示，用户应对收货人的行为及意思表示的法律后果承担连带责任。<br/>6.2由于市场变化及各种以合理商业努力难以控制的因素的影响，北红商城无法保证您提交的订单信息中希望购买的商品都会有货；如您拟购买的商品，发生缺货，您有权取消订单。<br/>6.3作弊订单是指影响平台交易秩序的订单（包括但不限于未发生实际交易、多个帐户多次使用同一收货地址、多个帐户多次使用同一支付账号等行为且未通过平台反作弊技术审核的；），北红商城可根据运营需要，修订作弊订单的判定和技术审核规则；对作弊订单，北红商城保留取消订单、取消优惠券、删除相关用户帐户的权利，并有权追究相关方的法律责任。<br/>第七条配送<br/>因如下情况造成订单延迟或无法配送等，销售方不承担延迟配送的责任：<br/>（1）用户提供的信息错误、地址不详细等原因导致的；<br/>（2）货物送达后无人签收，导致无法配送或延迟配送的；<br/>（3）国家政策法规等因素导致的；<br/>（4）不可抗力因素导致的，例如：自然灾害、交通戒严、突发战争等。<br/>第八条所有权及知识产权条款<br/>8.1提供的网络服务中包含的任何文本、图片、图形、音频和/或视频资料均受版权、商标和/或其它财产所有权法律的保护，未经相关权利人同意，上述资料均不得用于任何商业目的。<br/>8.2为提供网络服务而使用的任何软件（包括但不限于软件中所含的任何图象、照片、动画、录像、录音、音乐、文字和附加程序、随附的帮助材料）的一切权利均属于该软件的著作权人，未经该软件的著作权人许可，用户不得对该软件进行反向工程、反向编译或反汇编。<br/>第九条责任限制及不承诺担保<br/>9.1北红商城不担保网络服务一定能满足用户的要求，也不担保网络服务不会中断，对网络服务的及时性、安全性、准确性也都不作担保。<br/>9.2对于因电信系统或互联网网络故障、计算机故障或病毒、信息损坏或丢失、计算机系统问题或其它任何不可抗力原因而产生损失，北红商城不承担任何责任，但将尽力减少因此而给用户造成的损失和影响。<br/>第十条协议更新及用户关注义务<br/>根据国家法律法规变化及网站运营需要，北红商城有权对本协议条款不时地进行修改，修改后的协议一旦被张贴在北红商城上即生效，并代替原来的协议。用户可随时登录查阅最新协议；用户有义务不时关注并阅读最新版的协议及公告。如用户不同意更新后的协议，可以且应立即停止接受北红商城依据本协议提供的服务；如用户继续使用本网站提供的服务的，即视为同意更新后的协议。建议您在使用北红商城之前阅读本协议及公告。如果本协议中任何一条被视为废止、无效或因任何理由不可执行，该条应视为可分的且并不影响任何其余条款的有效性和可执行性。<br/>第十一条法律管辖和适用<br/>本协议的订立、执行和解释及争议的解决均应适用在中华人民共和国大陆地区适用之有效法律（但不包括其冲突法规则）。如发生本协议与适用之法律相抵触时，则这些条款将完全按法律规定重新解释，而其它有效条款继续有效。如缔约方就本协议内容或其执行发生任何争议，双方应尽力友好协商解决；协商不成时，任何一方均可青岛有管辖权的法院提起诉讼。<br/>第十二条其他<br/>12.1北红商城尊重用户和消费者的合法权利，本协议及本网站上发布的各类规则、声明等其他内容，均是为了更好地、更加便利地为用户和消费者提供服务。北红商城欢迎用户和社会各界提出意见和建议，北红商城将虚心接受并适时修改本协议及北红商城上的各类规则。<br/>12.2您点击本协议下方的“同意并继续”按钮即视为您完全接受本协议，在点击之前请您再次确认已知悉并完全理解本协议的全部内容。</p>','0');
